export default function VideoDetailsBlock() {
  return (
    <div className="row videoDetailsBlock">


        <div className="col-1-of-2">
          <h4> Item 1</h4>
          <span> Item 2</span>
        </div>
        <div className="col-1-of-2">
          <ul className="list-pay">
            <li> Item 1</li>
            <li> Item 2</li>
            <li> Item 3</li>
            <li> Item 4</li>
            <li> Item 5</li>
          </ul>

      </div>
    </div>
  );
}
